{"7": ["Прислали не тот размер ", "2020-04-07T06:37:09.111393251Z", "colorless", "0", 1, 0, 1, "Щетка стеклоочистителя гибридная 26 дюймов (65 см)", "Michelin"], "13": ["Заказывал 65 см, прислали 53, отказ. Прошу не учитывать процент выкупа.", "2020-05-04T03:26:32.516264346Z", "colorless", "0", 1, 0, 1, "Щетка стеклоочистителя гибридная 26 дюймов (65 см)", "Michelin"], "18": ["Здравствуйте, товар может и хороший, но вместо 26 дюймов пришли 24, плюс раскрыта упаковка! Прошу не пересчитывать процент выкупа!!!", "2020-04-08T12:33:47.440683873Z", "colorless", "0", 1, 0, 5, "Щетка стеклоочистителя гибридная 26 дюймов (65 см)", "Michelin"], "21": ["Прислали щётку не того размера , завтра поедем сдавать !!! ", "2020-03-31T15:38:22.313597472Z", "colorless", "0", 2, 0, 3, "Щетка стеклоочистителя гибридная 26 дюймов (65 см)", "Michelin"], "23": ["Заказывал два стеклоочистителя на 26\",но один пришёл на 21\".Поэтому возврат. Надо быть повнимательнее службе сборки заказов.", "2020-03-27T15:58:07.730998087Z", "colorless", "0", 2, 0, 5, "Щетка стеклоочистителя гибридная 26 дюймов (65 см)", "Michelin"], "25": ["Прошу не вычитать процент выкупа, пришло не то что заказывала.", "2020-03-28T10:56:36.363102707Z", "colorless", "0", 2, 0, 1, "Щетка стеклоочистителя гибридная 26 дюймов (65 см)", "Michelin"], "26": ["Добрый день) упаковка пришла вскрытая, обидно то что не обратил внимание на дефект ) фото прилагается)", "2020-03-25T09:58:25.811637914Z", "colorless", "0", 1, 0, 3, "Щетка стеклоочистителя гибридная 26 дюймов (65 см)", "Michelin"], "27": ["Поставил и сразу оценка минус. Мажут. Не советую брать. Своих денег не стоит.", "2020-02-09T10:10:08.342506537Z", "colorless", "0", 0, 1, 1, "Щетка стеклоочистителя гибридная 26 дюймов (65 см)", "Michelin"], "28": ["Просто обман... И что самое интересное, похоже это поощряется... Не одной звезды... К товару претензий нет, он качественный.", "2020-01-26T09:38:27.987504394Z", "colorless", "0", 2, 1, 1, "Щетка стеклоочистителя гибридная 26 дюймов (65 см)", "Michelin"], "29": ["Упаковка рваная.Не соответствует размеру.", "2020-01-20T14:36:51.952575586Z", "colorless", "0", 4, 0, 1, "Щетка стеклоочистителя гибридная 26 дюймов (65 см)", "Michelin"], "31": ["Щетки отличные!!! однажды попробовал их вместе с дюпонтовскими, в итоге теперь стараюсь купить только их. трут отлично, в том числе и зимой, ходят долго, нареканий нет. были бы они только всегда в продаже...спасибо.", "2019-12-27T09:43:22.448283168Z", "colorless", "0", 2, 0, 5, "Щетка стеклоочистителя гибридная 26 дюймов (65 см)", "Michelin"]}
